        &lt;p style="color:red; font-weight:bold;"&gt;Domínio nome {0} não existe no banco de dados&lt;/p&gt;
        &lt;p&gt;DotNetNuke suporta vários sites a partir de um único banco de dados/codebase. Ele realiza
    isso, convertendo a URL do navegador do cliente solicitar um PortalID válido em
        a tabela de banco de dados de portais. As etapas a seguir descrevem o processo:&lt;/p&gt;
    &lt;ol style="text-align: left; list-style-type: decimal; list-style-position: outside;"&gt;
        &lt;li&gt;&lt;strong&gt;Processamento do servidor Web&lt;/strong&gt;&lt;br&gt;
            &lt;ul style="list-style-type: disc;"&gt;
                &lt;li&gt;Quando um servidor web recebe uma solicitação de um navegador do cliente, ele compara o arquivo
                    extensão de nome do recurso de URL de destino para seus mapeamentos de extensão de aplicativo
                    definido no IIS.&lt;/li&gt;
                &lt;li&gt;Baseado no jogo correspondente, IIS então envia a solicitação para o arquivo executável definido
                    Caminho (aspnet_asapi.dll no caso de solicitações ASP.NET).&lt;/li&gt;
                &lt;li&gt;O motor do Aspnet_isapi. dll processa a solicitação em uma série ordenada de eventos
                    começando com Application_BeginRequest.&lt;/li&gt;
            &lt;/ul&gt;
        &lt;/li&gt;
        &lt;li&gt;&lt;strong&gt;HttpModule.URLRewrite OnBeginRequest (UrlRewriteModule.vb)&lt;/strong&gt;&lt;br&gt;
            &lt;ul style="list-style-type: disc;"&gt;
                &lt;li&gt;O URL de solicitação é analisada com base no caractere "/"&lt;/li&gt;
                &lt;li&gt;Um nome de domínio é construído usando cada um dos segmentos relevantes de URL analisados.&lt;br&gt;
                    &lt;br&gt;Exemplos:&lt;br&gt;
                    &lt;br&gt;URL: http://www.domain.com/default.aspx = nome de domínio: www.domain.com&lt;br&gt;URL: http://209.75.24.131/default.aspx = nome de domínio: 209.75.24.131&lt;br&gt;URL: http://localhost/DotNetNuke/default.aspx = Domain Name: localhost/DotNetNuke&lt;br&gt;URL: http://www.domain.com/virtualdirectory/default.aspx = nome de domínio: www.domain.com/virtualdirectory&lt;br&gt;URL: http://www.domain.com/directory/default.aspx = nome de domínio: www.domain.com/directory&lt;br&gt;
                    &lt;br&gt;
                &lt;/li&gt;
                &lt;li&gt;Usando o nome de domínio, o aplicativo consulta o banco de dados (tabela de portais - PortalAlias
                    campo) para localizar um registro correspondente.&lt;br&gt;
                    &lt;br&gt;Nota: Se há várias URLs que correspondem ao mesmo site então o alias do site
                    campo deve conter cada nome de domínio válido em uma lista separada por vírgulas.&lt;br&gt;
                    &lt;br&gt;Exemplo:&lt;br&gt;
                    &lt;br&gt;URL: http://localhost/DotNetNuke/default.aspx&lt;br&gt;URL: http://MACHINENAME/DotNetNuke/default.aspx&lt;br&gt;URL: http://209.32.134.65/DotNetNuke/default.aspx&lt;br&gt;PortalAlias: localhost/DotNetNuke,MACHINENAME/DotNetNuke,209.32.134.65/DotNetNuke&lt;br&gt;
                    &lt;br&gt;Nota: Se você estiver instalando o aplicativo em um servidor remoto você deve modificar o
                    PortalAlias valor do campo para o registro padrão da tabela de portais de acordo com
                    as regras definidas acima.&lt;/li&gt;
            &lt;/ul&gt;
        &lt;/li&gt;
    &lt;/ol&gt;
&lt;/div&gt;

